 import React from "react";

function App() {
  return (
    <div className="app">
      <header className="header">
        <h1>INC Event Management</h1>
      </header>
      <main>
        <p>Welcome to the Event Management dashboard.</p>
      </main>
    </div>
  );
}

export default App;
